            "created": 1425929666000, 
            "description": "<p>Recently, there has been significant buzz about the potential for new technologies to disrupt the market for legal services. In the meantime, a quiet \"evolution\" is occurring, as new digital tools are being integrated into traditional practice settings at a rapid pace. Inside forward-looking law firms and corporate legal departments, lawyers are creating technology-based solutions to increase the effectiveness of legal services. These lawyers are maintaining the highest quality of services while using technologies as a multiplier to drive down client costs.\u00a0</p> <p>This important day-and-a-half conference, sponsored with the ABA Journal, examines how legal technologies are being adopted in many practice areas including litigation, transactional work, compliance, and intellectual property. Each panel's presenters will demonstrate how a new technology they have developed supports improved service delivery. Attendees will have the opportunity to learn how law firms and legal departments are using technology-based tools to address client needs and explore how these approaches enhance the effectiveness of law practice.\u00a0</p> <p>The conference opens with the Iron Tech Lawyer competition on April 22nd from 1:15-3:30 and continues through April 23rd, with panels on technologies in litigation, digital tools in contract management, due diligence, and intellectual property, cross-practice technologies, legal technology careers, and access to justice and open government.\u00a0</p> <p>REGISTRATION = $45 for members of DC Legal Hackers.\u00a0</p> <p><a href=\"http://www.law.georgetown.edu/continuing-legal-education/programs/academic-conferences/Legal-Tech.cfm\">YOU MUST REGISTER HERE.\u00a0</a></p>", 
