            "created": 1424571116000, 
            "description": "<p>Oft requested but often avoided due to the pain that is install parties... a Django class! Learn the basics of using Django to create a basic app. We will be going over:</p> <p>\u2022 Setting up a basic project</p> <p><br/>\u2022 Creating a model</p> <p><br/>\u2022 Setting up the admin</p> <p><br/>\u2022 Creating views</p> <p><br/>\u2022 Adding in templates</p> <p><br/>This class will be held remotely using the Cloud 9 IDE. This IDE is free, and will make troubleshooting your environment a ton easier for us!\u00a0</p> <p>This class will be held via Google Hangouts on Air. You can watch it via YouTube or through Google+. There will also be a chat room where you can chat with other students and get help from volunteers.\u00a0</p> <p>You will need:</p> <p>\u2022 Coffee. We start early!</p> <p><br/>\u2022 A good Internet connection. Don't try to do this at a coffee shop!</p> <p><br/>\u2022 A Cloud 9 account (<a href=\"http://c9.io\" class=\"linkified\">http://c9.io</a>)</p> <p>\u2022 A Github account (<a href=\"http://github.com\" class=\"linkified\">http://github.com</a>)</p>", 
