            "created": 1424279774000, 
            "description": "<p><b>Meetup Format\u00a0</b></p> <p>The Front End Hack Night (FEHN) study group is a space where women can come together and help each other learn and understand web development. We welcome devs of all levels and encourage those with more experience to help out those that are just starting.\u00a0</p> <p>There's always at least one mentor/leader present to help you with best practices or to guide you through if you are stuck with a nasty problem! Every study group will have the following format:</p> <p>\u2022\u00a06:30pm - Begin</p> <p>\u2022\u00a06:40 - 6:50pm - Quick Introductions</p> <p>\u2022\u00a06:50 - 8:00pm - CODE!</p> <p>\u2022\u00a08:00 - 8:15pm - Lightning Talk (a quick presentation or talk) (if scheduled)</p> <p>\u2022\u00a08:15 - 8:30pm - Wrap Up</p> <p><b>RESOURCES</b></p> <p>To learn more about us please visit,\u00a0<a href=\"http://bit.ly/1LzKMbY\"><a href=\"http://bit.ly/1LzKMbY\" class=\"linkified\">http://bit.ly/1LzKMbY</a></a></p> <p><b>Building Access</b></p> <p>Certain building managements requires meetup hosts to let people in and do not encourage them being contacted. Please respect the policy, in case the location requires access to the building contact the group lead if information is provided, or drop a comment on the meetup page. We'll come and get you.</p> <p><b>All Women Welcome\u00a0</b></p> <p>This event is intended to be exclusively open for people who identify as women - we are transgender friendly.</p>", 
