            "created": 1423851955000, 
            "description": "<p>This event will be a fun collaboration with the <a href=\"http://hot.openstreetmap.org/\">Humanitarian OpenStreetMap Team</a>. The Humanitarian OpenStreetMap Team [HOT] applies the principles of open source and open data sharing for humanitarian response and economic development.</p> <p>1. Learn about the Humanitarian OpenStreetMapTeam (HOT)<br/>2. Get introduced to OpenStreetMap and<br/>3. Dive into contributing to a HOT project using the tasking manager.</p> <p><a href=\"http://tasks.hotosm.org/\">OSM Tasking Manager</a> is a mapping tool designed and built for the Humanitarian OSM Team collaborative mapping. The purpose of the tool is to divide up a mapping job into smaller tasks that can be completed rapidly. It shows which areas need to be mapped and which areas need the mapping validated.\u00a0</p> <p><br/>This approach facilitates the distribution of tasks to the various mappers in a context of emergency. It also permits to control the progress and the homogeinity of the work done (ie. Elements to cover, specific tags to use, etc.).</p>", 
