            "created": 1417881835000, 
            "description": "<p><b>What You'll Learn</b></p> <p>PL/R is a PostgreSQL extension that allows the use of R from within\u00a0PostgreSQL for advanced analytics in a simple, efficient, and\u00a0controlled manner. It has been available and actively maintained since\u00a0January 2003. PL/R works with all supported versions of PostgreSQL,\u00a0and all recent versions of R. It is used by thousands of people worldwide.</p> <p>Recent trends in big data favor bringing the analytics closer to the\u00a0data \u2013 meanwhile PL/R has been quietly providing this service for over\u00a010 years! This presentation will introduce the audience to PL/R,\u00a0discuss the pros and cons of this approach to data analysis, take you\u00a0through basic usage, and finally illustrate its power with a few\u00a0advanced examples.</p> <p><br/><b>Our Speaker</b></p> <p>Joe Conway is an innovative leader with broad experience in a wide\u00a0array of disciplines and extensive international business exposure. He\u00a0has been involved with PostgreSQL as a contributor since 2001. He is\u00a0also the author and maintainer of a PostgreSQL procedural language\u00a0handler for the R language, PL/R. Joe currently manages credativ USA,\u00a0which specializes in open source software with a comprehensive range\u00a0of services, including consulting, architectural and technical advice,\u00a0software development, training, and personalized support.</p> <p><br/><b>Agenda</b></p> <p>6:30 - Food and beverages</p> <p>7:00 - Intro and announcements</p> <p>7:15 - Talk</p> <p>8:30 - Head to Tonic for drinks</p>", 
