            "description": "<p>Please note you are\u00a0NOT\u00a0registered for this event by RSVPing on this meetup. Visit the <a href=\"http://sirjessthebrave.github.io/\">event page</a> for more information and to register for the event.\u00a0</p> <p>\n\n\nThe day is meant to be a place to come learn, bring a project and get some help, advice, solidarity, and to meet others from the community.\u00a0The JavaScript Guild from General Assembly and the Tech Team from RepEquity will be giving some short talks, advice, and help on projects.\u00a0</p> <p>\n\n\n<b>Schedule</b></p> <p><b>10:00 am\u00a0</b>Arrive and Caffeinate</p> <p><b>10:30 am\u00a0</b>Introductions</p> <p><i>After this, we will break into a project area and a workshop area feel free to float between these!</i></p> <p><br/><b>11:00 am\u00a0</b>Intro to Git and Version Control</p> <p><b>11:15 am\u00a0</b>Content Management Systems for Web Devs (Drupal focus)</p> <p><b>12:30 pm </b>LUNCH!</p> <p><b>1:00 pm\u00a0</b>Project and play time!</p> <p><b>4:00 pm\u00a0</b>Presentations and Happy Hour</p> <p><b>4:30 pm\u00a0</b>Tearful Goodbye's and Yuppie Business Card Exchange</p> <p><b>5:00 pm </b>Let's be realistic, we are headed for post drinks and noms...</p> <p>\n\n\n\nIf you're looking for more information feel free to contact\u00a0Jessica Bell ([masked]), front end developer at RepEquity.</p>", 
