            "created": 1417881835000, 
            "description": "<p><b>What You'll Learn</b></p> <p>Data quality is a fundamental issue for data science that can be measured in many different ways.\u00a0 Whether the data is stored in a relational database, a hierarchical file, or in key/value pairs, the reliability of your analysis depends on the quality of the data involved.\u00a0 In this talk, Joe Sremack will discuss what data quality is, the categories in which data quality can be measured, and common data quality issues.\u00a0 Sample data and Python code will be shown to illustrate what data quality issues are and how they can be identified.</p> <p><b>Our Speaker</b></p> <p>Joe Sremack is a Director in Berkeley Research Group\u2019s Technology Services Group.\u00a0 He has spent over a decade performing digital investigations for some of the largest civil and criminal cases in US History, such as the Bernie Madoff and Allen Stanford Ponzi scheme investigations.\u00a0 His work involves the collection and analysis of organizations\u2019 data, where data quality is a frequent issue</p> <p><b>Agenda</b></p> <p>6:30 - Food &amp; drinks</p> <p>7:00 - Intro</p> <p>7:10 - Talk</p> <p>8:30 - Drinks at Tonic</p>", 
